import React from "react";
import Card from "./Card.js";
function Main() {
   return (
      <>
         <Card 
         img = "./images/card-1.jpg"
         star ="5.0" />
         <Card
          img = "./images/card-2.jpg"/>
         <Card img = "./images/card-3.png" />
         <Card img = "./images/card-4.jpg" />
      </>
   );
}
export default Main;
